#include <chrono>
using namespace std;

//funcion de swap o intercambio de 2 variables
void intercambio(vector<int>&vI1, int j){
  //nos ayudamos de 1 variable para hacer el cambio de variables
    int aux = vI1[j];
    vI1[j]=vI1[j+1];
    vI1[j+1]=aux;
}


int mezcla(vector<int>&vM,int inicio, int centro, int fin){//O(nlog2(n))
  
  //variabes necesarias para la funcion mezcla
  int numeroListaAux = fin - inicio+1;
  
  vector <int> listAyuda(numeroListaAux); 
  int numCompM = 0; //Numero de comparaciones Mezcla
  int x = inicio;
  int y = centro+1; 
  int i = 0; 

  int k;
  //ciclo para acomodar las listas ya ordenadas hasta que una se vacie
  while (x<=centro && y<=fin){
    if(vM[x]<vM[y]){
      numCompM ++;
      listAyuda[i]  = vM[x];
      x++;
    }else{
      listAyuda[i] = vM[y];
      y++;
      numCompM++;
    }
    i++;
  }
  
//seleccionar la lista no vacia para rellenar la lista auxiliar
  if (centro<x){
    k = y;
  }else{
    k = x;
    fin = centro;
  }
//3 horas invertidas sin que funcionara esta funcion porque a q<=fin le faltaba el =
  for (int q = k; q<=fin; q++){
    listAyuda[i] = vM[q];
    i++;
  }

//llenar la lista original con la lista auxiliar

  for (int a = 0; a<numeroListaAux;a++){
    vM[inicio + a] = listAyuda[a];
  }
  return numCompM;
}

//funcion recursiva para dividir la lista en lista ya ordenadas
int mergeSort(vector<int>&vmS,int inicio, int fin){//O(n)
  int numCompMS = 0;
  if (inicio<fin){
    int centro = (inicio+fin)/2;
    mergeSort(vmS, inicio,centro);
    mergeSort(vmS, centro+1,fin);
    numCompMS = numCompMS + mezcla(vmS,inicio,centro,fin);
 }
  return numCompMS;
}

//funcion para llamar a merge
int ordenaMerge(vector<int>& oM){
  int numCompOM = mergeSort(oM,0,oM.size()-1);
  return numCompOM; //Comparaciones finales
}

